import {
  Collapse,
  Navbar,
 NavbarBrand,
  NavItem,
  NavLink,
  NavbarText,
} from 'reactstrap';

function NAVBAR() {
  return (
    <div>
      <Navbar>
        <NavbarBrand href="/">reactstrap</NavbarBrand>
        <Collapse>

          <NavItem>
              <NavLink href="#!">
              Login
              </NavLink>
              </NavItem>
          <NavbarText>Register</NavbarText>
        </Collapse>
      </Navbar>
    </div>
  );
}
export default NAVBAR;
